        "title": "GoPro Snow: The Fourth Phase with Travis Rice - Ep. 1 ALASKA: Seek & Destroy",
        "description": "Travis and fellow rider Eric Jackson take us to the top of powder-packed peaks and chutes across Alaska. Travis also goes on a search for the infamous \"Alaska Crack.\" Not only does he slay that line, he goes on a binge, finding a ton of cracks across this zone - and he takes us along for the ride. \n\nStay tuned for remaining episodes for this series, dropping on GoPro's YouTube channel on the following dates: \n\nTuesday, October 18 - Ep. 2 - Wyoming: Life on Mars \nTuesday, October 25 - Ep. 3 - Japan: Peaks, Pillows & Pow \nTuesday, November 1 - Ep. 4 - Alaska: The Reciprocal Loop \n\nWhere to buy \"The Fourth Phase:\" \nThe film is now available for purchase here: http://radi.al/TheFourthPhase. \n\nMore on 'GoPro Perspectives: The Fourth Phase with Travis Rice' \nGoPro presents a four-part series - 'GoPro Perspectives: The Fourth Phase with Travis Rice' - which lends an intimate view of what it's like to be Travis Rice, as he drops in on some of the world's biggest lines during the filming of this Red Bull Media House production. \n\nBy tapping into Travis' mindset - much of the time through his head cam - we come to understand the skill and calculation that is essential to getting the shot and staying safe in the backcountry. \n\nAt its core, this series highlights some of the best action from \"The Fourth Phase,\" but it is also very much about the necessary friendship between Travis and his fellow riders - Eric Jackson, Mark Landvik and Victor de Le Rue. \n\nEach episode begins with a raw moment that's best captured from the GoPro point of view.  In this partnership with Red Bull Media House, GoPro has searched through nearly two years of the best GoPro footage to reveal this story to the action sports community. \n\nStay tuned for more episodes and #GoProSnow content throughout this fall and into Winter 2017.\n\nShot 100% on the HERO4¬Æ camera from \u202ahttp://GoPro.com.\n\nGet stoked and subscribe: http://goo.gl/HgVXpQ\n\nTo licens