        "title": "Is Time Real?",
        "description": "Check out the physics courses that I mentioned (many of which are free!) and support this channel by going to https://brilliant.org/Sabine/ where you can create your Brilliant account. The first 200 will get 20% off the annual premium subscription.\n\nCorrection: The photo at about 1 mins doesn't show Hermann Minkowski (who is the one I meant) but his brother Oskar. Sorry about that. \n\nIn this video I explain why some physicists argue that time does not exist, and what that even means.\n\nYou can support me on Patreon: \n\nhttps://www.patreon.com/Sabine?fan_landing=true\n\nYou can join the chat on this week's video today (Sat, Jan 2, 2021) at 6pm CET or noon Eastern Time here:\n\nhttps://talk.conversful.com/c?id=-MPf9wLFMRVHuSmGpa7V\n\n#physics #education #science #philosophy\n\n0:00 Intro\n0:23 What is time?\n3:37 How do clocks work?\n4:19 What do physicists mean with \"Time is not real\"?\n6:57 What might a theory without time look like?\n8:43 Sponsor Message",
